import React, { Component } from 'react';

class Body extends Component {
    render(){
        const divStyle = {
            background: "#eeeeee",
            width: "100%",
            heigth: "100%"
        }
        return (
            <div style={divStyle}>
             HELLO WORLD
            </div>
        )
    }
}

export default Body;
